INSERT INTO `paintings` VALUES ('5', '1', '20', '001050.jpg', 'Self-portrait (Yo)', '1', 'http://www.moma.org/collection/works/80026?locale=en', '587.1998', 'Estate of Pablo Picasso / Artists Rights Society', null, null, '1901', '54', '32', 'Oil on cardboard on panel', '125.0000', '135.0000', '2022-05-24 19:00:17', null, '29', '0');
INSERT INTO `paintings` VALUES ('7', '1', '7', '001080.jpg', 'Family of Saltimbanques', '3', 'http://www.nga.gov/content/ngaweb/Collection/art-object-page.46665.html', '1963.10.190', 'Estate of Pablo Picasso/Artists Rights Society', '<em>Family of Saltimbanques</em> (La famille de saltimbanques) is a 1905 painting by Pablo Picasso. It is considered the masterpiece of Picasso\'s circus period. The painting depicts six saltimbanques, a kind of itinerant circus performer, in a desolate landscape. The composition groups them together, but they do not seem connected to each other and are not looking at each other.[', '<em>Family of Saltimbanques</em> (La famille de saltimbanques) is a 1905 painting by Pablo Picasso. It is considered the masterpiece of Picasso\'s circus period.', '1905', '213', '230', 'Oil on canvas', '440.0000', '570.0000', '2022-05-24 19:00:34', 'icalter', '37', '0');
INSERT INTO `paintings` VALUES ('8', '1', '11', '001090.jpg', 'Portrait of Daniel-Henry Kahnweiler', '1', 'http://www.artic.edu/aic/collections/artwork/111060', null, 'Estate of Pablo Picasso / Artists Rights Society', 'In 1907 Picasso joined an art gallery that had recently been opened in Paris by Daniel-Henry Kahnweiler. Kahnweiler was a German art historian, art collector who became one of the premier French art dealers of the 20th century. He was among the first champions of Pablo Picasso, Georges Braque and the Cubism that they jointly developed. Kahnweiler promoted burgeoning artists such as André Derain, Kees Van Dongen, Fernand Léger, Juan Gris, Maurice de Vlaminck and several others who had come from all over the globe to live and work in Montparnasse at the time.', 'In 1907 Picasso joined an art gallery that had recently been opened in Paris by Daniel-Henry Kahnweiler. Kahnweiler was a German art historian, art collector who became one of the premier French art dealers of the 20th century.', '1910', '101', '73', 'Oil on canvas', '900.0000', '1000.0000', '2022-05-24 19:00:34', null, '0', '0');
INSERT INTO `paintings` VALUES ('11', '1', '13', '001130.jpg', 'Self Portrait With A Palette', '1', 'http://www.philamuseum.org/collections/permanent/50947.html', '1950-1-1', 'Estate of Pablo Picasso / Artists Rights Society', 'This self-portrait casts the twenty-five-year-old painter as a hardy, athletic figure and sets the stage for the legend of Picasso as the artistic champion of the twentieth century. In preparatory drawings the artist included a brush in his right hand, but he removed it in this final version. Its absence attests to the notion that creative genius is not simply manual dexterity but the expression of an inner vision, here symbolized by the artist’s intense, staring eyes.', 'This self-portrait casts the twenty-five-year-old painter as a hardy, athletic figure and sets the stage for the legend of Picasso as the artistic champion of the twentieth century.', '1906', '92', '73', 'Oil on canvas', '500.0000', '800.0000', '2022-05-24 19:00:34', null, '220', '0');
INSERT INTO `paintings` VALUES ('12', '1', '6', '001150.jpg', 'Portrait of Gertrude Stein', '1', 'http://www.metmuseum.org/art/collection/search/488221', '47.106', 'Estate of Pablo Picasso / Artists Rights Society', 'By 1905 Picasso became a favorite of the American art collectors Leo and Gertrude Stein. Their older brother Michael Stein and his wife Sarah also became collectors of his work. Picasso painted portraits of both Gertrude Stein and her nephew Allan Stein. Gertrude Stein became Picasso\'s principal patron, acquiring his drawings and paintings and exhibiting them in her informal Salon at her home in Paris. At one of her gatherings in 1905, he met Henri Matisse, who was to become a lifelong friend and rival. The Steins introduced him to Claribel Cone and her sister Etta who were American art collectors; they also began to acquire Picasso and Matisse\'s paintings. Eventually Leo Stein moved to Italy, and Michael and Sarah Stein became patrons of Matisse; while Gertrude Stein continued to collect Picasso.', 'By 1905 Picasso became a favorite of the American art collectors Leo and Gertrude Stein. Their older brother Michael Stein and his wife Sarah also became collectors of his work. Picasso painted portraits of both Gertrude Stein and her nephew Allan Stein.', '1907', '100', '81', 'oil on canvas', '620.0000', '800.0000', '2022-05-24 19:00:34', null, '11', '0');
INSERT INTO `paintings` VALUES ('35', '6', '16', '006030.jpg', 'La Grande Odalisque', '2', 'http://www.louvre.fr/en/oeuvre-notices/une-odalisque', 'R.F. 1158', '&copy; Musée du Louvre', '<em>Grande Odalisque</em>, also known as Une Odalisque or La Grande Odalisque, is an oil painting of 1814 by Jean Auguste Dominique Ingres depicting an odalisque, or concubine. Ingres\' contemporaries considered the work to signify Ingres\' break from Neoclassicism, indicating a shift toward exotic Romanticism.\r\nGrande Odalisque attracted wide criticism when it was first shown. It has been especially noted for the elongated proportions and lack of anatomical realism. The work is housed in the Louvre, Paris.\r\nThis eclectic mix of styles, combining classical form with Romantic themes, prompted harsh criticism when it was first shown in 1814. Critics viewed Ingres as a rebel against the contemporary style of form and content. When the painting was first shown in the Salon of 1819, one critic remarked that the work had \"neither bones nor muscle, neither blood, nor life, nor relief, indeed nothing that constitutes imitation\".[3] This echoed the general view that Ingres had disregarded anatomical realism.[4] Ingres instead favored long lines to convey curvature and sensuality, as well as abundant, even light to tone down the volume. Ingres continued to be criticized for his work until the mid-1820s.', '<em>Grande Odalisque</em>, also known as Une Odalisque or La Grande Odalisque, is an oil painting of 1814 by Jean Auguste Dominique Ingres depicting an odalisque, or concubine. Ingres\' contemporaries considered the work to signify Ingres\' break from Neoclassicism, indicating a shift toward exotic Romanticism.', '1814', '89', '163', 'Oil on canvas', '125.0000', '175.0000', '2022-05-24 19:00:34', null, '0', '0');
INSERT INTO `paintings` VALUES ('36', '7', '16', '007020.jpg', 'Liberty Leading the People', '3', 'http://www.louvre.fr/en/oeuvre-notices/july-28-liberty-leading-people', 'R.F. 129', '&copy; Musée du Louvre', '<em>Liberty Leading the People</em> (French: La Liberté guidant le peuple) is a painting by Eugène Delacroix commemorating the July Revolution of 1830, which toppled Charles X of France. A woman personifying Liberty leads the people forward over the bodies of the fallen, holding the tricolore flag of the French Revolution in one hand and brandishing a bayonetted musket with the other. The painting is perhaps Delacroix\'s best-known work.\r\nDelacroix depicted Liberty, as both an allegorical goddess-figure and a robust woman of the people, an approach that contemporary critics denounced as \"ignoble\". The mound of corpses acts as a kind of pedestal from which Liberty strides, barefoot and bare-breasted, out of the canvas and into the space of the viewer. The Phrygian cap she wears had come to symbolize liberty during the first French Revolution, of 1789-94. The painting has been seen as a marker to the end of the Age of Enlightenment, as many scholars see the end of the French Revolution as the start of the romantic era.\r\nThe fighters are from a mixture of social classes, ranging from the bourgeoisie represented by the young man in a top hat, to the revolutionary urban worker, as exemplified by the boy holding pistols (who may have been the inspiration for the character Gavroche in Victor Hugo\'s Les Misérables). What they have in common is the fierceness and determination in their eyes. Aside from the flag held by Liberty, a second, minute tricolore can be discerned in the distance flying from the towers of Notre Dame.', '<em>Liberty Leading the People</em> (French: La Liberté guidant le peuple) is a painting by Eugène Delacroix commemorating the July Revolution of 1830, which toppled Charles X of France. A woman personifying Liberty leads the people forward over the bodies of the fallen, holding the tricolore flag of the French Revolution in one hand and brandishing a bayonetted musket with the other. The painting is perhaps Delacroix\'s best-known work.', '1830', '260', '325', 'Oil on canvas', '625.0000', '860.0000', '2022-05-24 19:00:34', null, '0', '0');
INSERT INTO `paintings` VALUES ('37', '10', '19', '010020.jpg', 'Burial at Ornans', '4', 'http://www.musee-orsay.fr/en/collections/works-in-focus/search/commentaire/commentaire_id/un-enterrement-a-ornans-130.html', 'RF 325', '&copy; Home', '<em>The Burial</em>, one of Courbet\'s most important works, records the funeral of his grandfather which he attended in September 1848. People who attended the funeral were the models for the painting. Previously, models had been used as actors in historical narratives, but in <em>Burial</em> Courbet said he \"painted the very people who had been present at the interment, all the townspeople\". The result is a realistic presentation of them, and of life in Ornans.\r\nThe vast painting—it measures 10 by 22 feet (3.1 by 6.6 meters)—drew both praise and fierce denunciations from critics and the public, in part because it upset convention by depicting a prosaic ritual on a scale which previously would have been reserved for a religious or royal subject.', '<em>The Burial</em>, one of Courbet\'s most important works, records the funeral of his grandfather which he attended in September 1848. People who attended the funeral were the models for the painting.', '1849', '314', '663', 'Oil on canvas', '1145.0000', '1190.0000', '2022-05-24 19:00:34', null, '0', '0');
INSERT INTO `paintings` VALUES ('39', '12', '36', '012060.jpg', 'Bar at the Folies Bergere', '2', 'http://courtauld.ac.uk/gallery/collection/impressionism-post-impressionism/edouard-manet-a-bar-at-the-folies-bergere', null, '&copy; The Courtauld Gallery', '<em>A Bar at the Folies-Bergère</em> (French: Un bar aux Folies Bergère), painted and exhibited at the Paris Salon in 1882, was the last major work by French painter Édouard Manet. It depicts a scene in the Folies Bergère nightclub in Paris.\r\nThe painting is filled with contemporaneous details specific to the Folies-Bergère. The distant pair of green feet in the upper left-hand corner belong to a trapeze artist, who is performing above the restaurant\'s patrons.\r\nThe beer which is depicted, Bass Pale Ale (noted by the red triangle on the label), would have catered not to the tastes of Parisians, but to those of English tourists, suggesting a British clientele. Manet has signed his name on the label of the bottle at the bottom left, combining the centuries-old practice of self-promotion in art with something more modern, bordering on the product placement concept of the late twentieth century. One interpretation of the painting has been that far from only being a seller of the wares shown on the counter, the woman is herself one of the wares for sale; conveying undertones of prostitution. The man in the background may be a potential client.\r\nBut for all its specificity to time and place, it is worth noting that, should the background of this painting indeed be a reflection in a mirror on the wall behind the bar as suggested by some critics, the woman in the reflection would appear directly behind the image of the woman facing forward. Neither are the bottles reflected accurately or in like quantity for it to be a reflection. These details were criticized in the French press when the painting was shown. The assumption is faulty when one considers that the postures of the two women, however, are quite different and the presence of the man to whom the second woman speaks marks the depth of the subject area. Indeed many critics view the faults in the reflection to be fundamental to the painting as they show a double reality and meaning to the work. One interpretation is that the reflection is an interaction earlier in time that results in the subject\'s expression in the painting\'s present.', '<em>A Bar at the Folies-Bergère</em> (French: Un bar aux Folies Bergère), painted and exhibited at the Paris Salon in 1882, was the last major work by French painter Édouard Manet. It depicts a scene in the Folies Bergère nightclub in Paris.', '1882', '96', '130', 'Oil on canvas', '125.0000', '200.0000', '2022-05-24 19:00:34', null, '0', '0');
INSERT INTO `paintings` VALUES ('41', '14', '6', '014040.jpg', 'At the Piano', '1', 'http://www.metmuseum.org/art/collection/search/459112', '1975.1.201', 'Open Access for Scholarly Content', 'In late 1891 or early 1892 Renoir was invited by the French government to execute a painting for a new museum in Paris, the Musée du Luxembourg, which was to be devoted to the work of living artists. He chose as his subject two girls at the piano. Aware of the intense scrutiny to which his submission would be subjected, Renoir lavished extraordinary care on this project, developing and refining the composition in a series of five canvases. The Lehman painting and the nearly identical version formerly in the collection of Renoir\'s fellow Impressionist Gustave Caillebotte have long been regarded as the most accomplished variants of this intimate and engaging scene of bourgeois domestic life.', 'Aware of the intense scrutiny to which his submission would be subjected, Renoir lavished extraordinary care on this project, developing and refining the composition in a series of five canvases.', '1892', '116', '90', 'Oil on canvas', '790.0000', '940.0000', '2022-05-24 19:00:34', null, '0', '0');
INSERT INTO `paintings` VALUES ('42', '15', '19', '015050.jpg', 'Glass of Absinthe', '1', 'http://www.musee-orsay.fr/en/collections/works-in-focus/search/commentaire/commentaire_id/dans-un-cafe-167.html', 'RF 1984', '&copy; Home', '<em>L\'Absinthe</em> (English: The Absinthe Drinker or Glass of Absinthe) is a painting by Edgar Degas. Some original title translations are A sketch of a French Café, then Figures at Café, the title was finally changed in 1893 to L’Absinthe (the name the piece is known by today). It is now in the permanent collection of the Musée d\'Orsay in Paris.\r\nPainted in 1875-1876, it depicts two figures, a woman and man, who sit in the center and right of this painting, respectively. The man, wearing a hat, looks right, off the canvas, while the woman, dressed formally and also wearing a hat, stares vacantly downward. A glass filled with the eponymous greenish liquid sits before her. The painting is a representation of the increasing social isolation in Paris during its stage of rapid growth.', '<em>L\'Absinthe</em> (English: The Absinthe Drinker or Glass of Absinthe) is a painting by Edgar Degas. Some original title translations are A sketch of a French Café, then Figures at Café, the title was finally changed in 1893 to L’Absinthe (the name the piece is known by today).', '1877', '92', '68', 'Oil on canvas', '1225.0000', '1300.0000', '2022-05-24 19:00:34', null, '0', '0');
INSERT INTO `paintings` VALUES ('45', '17', '19', '017020.jpg', 'Women in the Garden', '1', 'http://www.musee-orsay.fr/en/collections/works-in-focus/search/commentaire/commentaire_id/femmes-au-jardin-343.html', 'RF 2773', '&copy; Home', 'Monet’s technique of “en plein air” painting was hard at work on this painting. Because it necessitated that he work from the same point of view as he painted, he dug a trench for the bottom half of the painting to sit in while he painted the top, due to its large size (it measures 100 by 81 inches). His model for the women of the painting was Camille Doncieux, who would later become his wife, bearing him two sons. To finish the dresses in the most fashionable style, Monet used magazine illustrations to render the clothing.', 'Monet’s technique of “en plein air” painting was hard at work on this painting. Because it necessitated that he work from the same point of view as he painted, he dug a trench for the bottom half of the painting to sit in while he painted the top, due to its large size.', '1866', '205', '255', 'Oil on canvas', '850.0000', '1050.0000', '2022-05-24 19:00:34', null, '0', '0');
INSERT INTO `paintings` VALUES ('46', '17', '11', '017030.jpg', 'Stacks of Wheat (End of Summer)', '2', 'http://www.artic.edu/aic/collections/artwork/64818', null, 'Rights-Managed (RM)', 'The monumental stacks that Claude Monet depicted in his series Stacks of Wheat rose fifteen to twenty feet and stood just outside the artist’s farmhouse at Giverny. Through 1890 and 1891, he worked on this series both in the field, painting simultaneously at several easels, and in the studio, refining pictorial harmonies. In May 1891, Monet hung fifteen of these canvases next to each other in one small room in the Galerie Durand-Ruel in Paris. An unprecedented critical and financial success, the exhibition marked a breakthrough in Monet’s career, as well as in the history of French art.', 'The monumental stacks that Claude Monet depicted in his series Stacks of Wheat rose fifteen to twenty feet and stood just outside the artist’s farmhouse at Giverny.', '1891', '60', '100', 'Oil on canvas', '1200.0000', '1500.0000', '2022-05-24 19:00:34', null, '0', '0');
INSERT INTO `paintings` VALUES ('47', '17', '6', '017070.jpg', 'The Houses of Parliament (Effect of Fog)', '3', 'http://www.metmuseum.org/art/collection/search/437128', '56.135.6', 'Open Access for Scholarly Content', 'In the fall of 1899 and the early months of 1900 and of 1901, Monet executed a series of views of the Thames River in London. From his room at the Savoy Hotel, he painted Waterloo Bridge to the east, and Charing Cross Bridge to the west; beginning in February 1900, he set up his easel on a terrace at Saint Thomas\'s Hospital across the river, reserving time in the late afternoon to depict the Houses of Parliament.\r\n\r\nWhile in London, Monet produced nearly a hundred canvases, reportedly moving from one to another as the light changed. He continued to work on these paintings in his studio at Giverny. In May 1904, thirty-seven were exhibited at the Galerie Durand-Ruel in Paris, including this view of the Houses of Parliament cloaked in dense fog.', 'In the fall of 1899 and the early months of 1900 and of 1901, Monet executed a series of views of the Thames River in London. From his room at the Savoy Hotel, he painted Waterloo Bridge to the east, and Charing Cross Bridge to the west; beginning in February 1900, he set up his easel on a terrace at Saint Thomas\'s Hospital across the river, reserving time in the late afternoon to depict the Houses of Parliament.', '1903', '81', '92', 'Oil on canvas', '750.0000', '900.0000', '2022-05-24 19:00:34', null, '0', '0');
INSERT INTO `paintings` VALUES ('48', '17', '6', '017060.jpg', 'Water Lilies', '4', 'http://www.metmuseum.org/art/collection/search/438008', '1998.325.2', 'Open Access for Scholarly Content', 'Monet left much of his late work unfinished and released few paintings for sale, reporting that he was not yet satisfied and was still working on them \"with passion.\" This canvas is one of four water-lily pictures that, quite exceptionally, he did complete, sign, and sell in 1919.', 'Monet left much of his late work unfinished and released few paintings for sale, reporting that he was not yet satisfied and was still working on them \"with passion.\" This canvas is one of four water-lily pictures that, quite exceptionally, he did complete, sign, and sell in 1919.', '1919', '101', '200', 'Oil on canvas', '750.0000', '900.0000', '2022-05-24 19:00:34', null, '0', '0');
INSERT INTO `paintings` VALUES ('49', '17', '19', '017050.jpg', 'Rouen Cathedral, Full Sunlight', '1', 'http://www.musee-orsay.fr/en/collections/index-of-works/notice.html?no_cache=1&nnumid=001285', 'RF 2002', '&copy; Home', null, null, '1894', '107', '73', 'Oil on canvas', '1300.0000', '4125.0000', '2022-05-24 19:00:34', null, '0', '0');
INSERT INTO `paintings` VALUES ('50', '17', '7', '017040.jpg', 'Woman with a Parasol - Madame Monet and Her Son', '1', 'http://www.nga.gov/content/ngaweb/Collection/art-object-page.61379.html', '1983.1.29', 'Open Access', 'Woman with a Parasol was painted outdoors, probably in a single session of several hours\' duration. The artist intended the work to convey the feeling of a casual family outing rather than a formal portrait, and used pose and placement to suggest that his wife and son interrupted their stroll while he captured their likenesses. The brevity of the moment portrayed here is conveyed by a repertory of animated brushstrokes of vibrant color, hallmarks of the style Monet was instrumental in forming. Bright sunlight shines from behind Camille to whiten the top of her parasol and the flowing cloth at her back, while colored reflections from the wildflowers below touch her front with yellow.', 'Woman with a Parasol was painted outdoors, probably in a single session of several hours\' duration.', '1875', '100', '81', 'Oil on canvas', '500.0000', '940.0000', '2022-05-24 19:00:34', null, '0', '0');
INSERT INTO `paintings` VALUES ('51', '18', '50', '018020.jpg', 'Vision of the Sermon', '3', 'https://www.nationalgalleries.org/object/NG 1643', 'NG 1643', null, 'This painting depicts the scene from the Bible in which Jacob wrestles an angel. As if in a modern-day wrestling arena, French women watch the wrestling match from afar. This painting was created during Gaugin’s stay in Pont-Avon, France, which is where he created his other masterpieces, The Yellow Christ and The Green Christ. This painting also incorporates elements from his Christ series, which also place Breton French women alongside a Biblical scene, placing them as observers in the story. In his typical style, flat areas of color are outlined by thick black lines, and the figures are void of any shading or depth of color.', 'This painting depicts the scene from the Bible in which Jacob wrestles an angel. As if in a modern-day wrestling arena, French women watch the wrestling match from afar. This painting was created during Gaugin’s stay in Pont-Avon, France.', '1888', '74', '93', 'Oil on canvas', '230.0000', '290.0000', '2022-05-24 19:00:34', null, '0', '0');
INSERT INTO `paintings` VALUES ('52', '18', '29', '018030.jpg', 'Self-Portrait with Portrait of Émile Bernard (Les misérables)', '2', 'https://www.vangoghmuseum.nl/en/collection/s0224V1962', 's0224V1962', 'Non commercial use', 'Gauguin painted himself in the guise of Jean Valjean, the main character of Victor Hugo’s novel Les Misérables, equating the vibrant and loving fictional outcast with the misunderstood artists of his time.', 'Gauguin painted himself in the guise of Jean Valjean, the main character of Victor Hugo’s novel Les Misérables, equating the vibrant and loving fictional outcast with the misunderstood artists of his time.', '1888', '45', '55', 'Oil on canvas', '250.0000', '300.0000', '2022-05-24 19:00:34', null, '0', '0');
INSERT INTO `paintings` VALUES ('54', '18', '51', '018040.jpg', 'Yellow Christ', '3', 'https://www.albrightknox.org/collection/search/piece:360/', '360', 'Public Domain', '<em>The Yellow Christ</em>, in addition to <em>The Green Christ</em>, also painted by Gaugin, is said to be one of the key works in Cloisonnism. The Christ in the painting is a direct representation of a crucifix in Pont-Avon, France, where Gaugin visited to paint a number of times. It depicts a yellow form of Christ being crucified in 19th century northern France. French Breton women gather around the cross in prayer. The only shading in the painting is of the women bowed in prayer, the figure of Christ on the cross clearly outlined in black, and his form is flat, typical of the Gaugin’s symbolic style.', '<em>The Yellow Christ</em>, in addition to <em>The Green Christ</em>, also painted by Gaugin, is said to be one of the key works in Cloisonnism. The Christ in the painting is a direct representation of a crucifix in Pont-Avon, France, where Gaugin visited to paint a number of times.', '1889', '92', '73', 'Oil on canvas', '250.0000', '300.0000', '2022-05-24 19:00:34', null, '4', '0');
INSERT INTO `paintings` VALUES ('55', '18', '6', '018050.jpg', 'We Greet Thee Mary', '3', 'http://www.metmuseum.org/art/collection/search/438821', '51.112.2', 'Open Access for Scholarly Content', 'Before embarking on a series of pictures inspired by Polynesian religious beliefs, Gauguin devoted this, his first major Tahitian canvas, to a Christian theme, describing it in a letter of March 1892: \"An angel with yellow wings reveals Mary and Jesus, both Tahitians, to two Tahitian women, nudes dressed in pareus, a sort of cotton cloth printed with flowers that can be draped from the waist. Very somber, mountainous background and flowering trees . . . a dark violet path and an emerald green foreground, with bananas on the left. I\'m rather happy with it.\" Gauguin based much of the composition on a photograph he owned of a bas-relief in the Javanese temple of Borobudur.', 'Before embarking on a series of pictures inspired by Polynesian religious beliefs, Gauguin devoted this, his first major Tahitian canvas, to a Christian theme.', '1891', '114', '88', 'Oil on canvas', '900.0000', '1075.0000', '2022-05-24 19:00:34', null, '0', '0');
INSERT INTO `paintings` VALUES ('56', '18', '49', '018080.jpg', 'Where Do We Come From? What Are We? Where Are We Going?', '4', 'http://www.mfa.org/collections/object/where-do-we-come-from-what-are-we-where-are-we-going-32558', '36.270', 'Public domain', 'This is Paul Gaugin’s most famous painting, and he considered it his masterpiece, and the culmination of his thoughts. In Tahiti, as he was painting his masterpiece, Gaugin declared that he would commit suicide upon its completion. Although this was something he had previously attempted, this was not the case, as the artist died of syphilis in 1903. The painting was meant to be read from right to left, with the three main figures in the painting representing the three questions of the title. The figures are arranged from the beginning stages of life, from young figures with a child, to the middle aged figure in the middle, to the elder figure on the left of the painting. The idol in the background, situated behind the elder figure, represents the “Beyond.”', 'This is Paul Gaugin’s most famous painting, and he considered it his masterpiece, and the culmination of his thoughts. In Tahiti, as he was painting his masterpiece, Gaugin declared that he would commit suicide upon its completion.', '1897', '139', '375', 'Oil on canvas', '650.0000', '800.0000', '2022-05-24 19:00:34', null, '0', '0');
INSERT INTO `paintings` VALUES ('57', '19', '52', '019010.jpg', 'Self Portrait', '1', 'http://www.dia.org/object-info/662cf867-c9e6-4f6b-9281-8b5ca7dd6c72.aspx', '22.13', '&copy; Detroit Institute of Arts', null, null, '1887', '35', '27', 'Oil on canvas', '420.0000', '550.0000', '2022-05-24 19:00:34', null, '0', '0');
INSERT INTO `paintings` VALUES ('58', '19', '29', '019020.jpg', 'Potato Eaters', '2', 'https://www.vangoghmuseum.nl/en/collection/s0005V1962', 's0005V1962', 'Non commercial use', 'For <em>The Potato Eaters</em>, Van Gogh’s first major work, he wanted to depict peasants as they really were. He thus chose coarse and ugly models, so they would look as natural as possible in the final work. He made sketches of the work and sent them to his brother, who helped Van Gogh make adjustment in the composition. As far as two years after Van Gogh completed this painting, he considered it his finest work. This painting has also been a main target for art thieves, who have stolen it not once, but twice times. An early version of the painting was stolen in 1988, but later returned with no ransom, and again in 1991, when it was abandoned by the thieves and recovered.', 'For <em>The Potato Eaters</em>, Van Gogh’s first major work, he wanted to depict peasants as they really were. He thus chose coarse and ugly models, so they would look as natural as possible in the final work.', '1885', '82', '114', 'Oil on canvas', '1250.0000', '1350.0000', '2022-05-24 19:00:34', null, '0', '0');
INSERT INTO `paintings` VALUES ('60', '19', '29', '019050.jpg', 'Sunflowers', '1', 'https://www.vangoghmuseum.nl/en/collection/s0031V1962', 's0031V1962', 'Non commercial use', 'Van Gogh’s paintings of sunflowers are among his most famous. He did them in Arles, in the south of France, in 1888 and 1889. Vincent painted a total of five large canvases with sunflowers in a vase, with three shades of yellow ‘and nothing else’. In this way, he demonstrated that it was possible to create an image with numerous variations of a single colour, without any loss of eloquence.', 'The sunflower paintings had a special significance for Van Gogh: they communicated ‘gratitude’, he wrote.', '1889', '73', '95', 'Oil on canvas', '1300.0000', '1500.0000', '2022-05-24 19:00:34', null, '0', '0');
INSERT INTO `paintings` VALUES ('61', '19', '29', '019040.jpg', 'Décoration for the Yellow House', '2', 'https://www.vangoghmuseum.nl/en/collection/s0032V1962', 's0032V1962', 'Non commercial use', 'The Décoration for the Yellow House was the main project Vincent van Gogh focused on in Arles, from August 1888 until his breakdown the day before Christmas. This Décoration had no pre-defined form or size; the central idea of the Décoration grew step by step, with the progress of his work. Starting with the Sunflowers, portraits were included in the next step. Finally, mid-September 1888, the idea took shape: from this time on he concentrated on size 30 canvases (Toiles de 30), which were all meant to form part of this Décoration', '<em>Sunflowers</em> (original title, in French: Tournesols) are the subject of two series of still life paintings by the Dutch painter Vincent van Gogh. The earlier series executed in Paris in 1887 gives the flowers lying on the ground, while the second set executed a year later in Arles shows bouquets of sunflowers in a vase.', '1888', '72', '92', 'Oil on canvas', '1290.0000', '1540.0000', '2022-05-24 19:00:34', null, '0', '0');
INSERT INTO `paintings` VALUES ('63', '19', '20', '019070.jpg', 'Starry Night', '3', 'http://www.moma.org/collection/works/79802?locale=en', '472.1941', '&copy; Art Resource', 'In the later part of his life, Van Gogh committed himself to an asylum in Saint Remy de Provence. <em>The Starry Night</em> was the view from the window in Van Gogh’s sanitarium bedroom. Although it is a night scene, it was painted during the day. The painting is often referred to as Van Gogh’s magnus opus. As he often sent his works to his brother Theo for his approval, he mailed this one to him in late 1889. He also wrote that he was not so happy about the work, which did not seem complete, as he had originally intended it to simply be a study of the night sky.', 'In the later part of his life, Van Gogh committed himself to an asylum in Saint Remy de Provence. <em>The Starry Night</em> was the view from the window in Van Gogh’s sanitarium bedroom. Although it is a night scene, it was painted during the day.', '1889', '74', '92', 'Oil on canvas', '1340.0000', '1410.0000', '2022-05-24 19:00:34', null, '0', '0');
INSERT INTO `paintings` VALUES ('64', '19', '36', '019060.jpg', 'Self Portrait With Bandaged Ear', '1', 'http://courtauld.ac.uk/gallery/collection/impressionism-post-impressionism/vincent-van-gogh-self-portrait-with-bandaged-ear', null, '&copy; The Courtauld Gallery', 'This self-portrait was painted shortly after Van Gogh returned home from hospital having mutilated his own ear.', 'This self-portrait was painted shortly after Van Gogh returned home from hospital having mutilated his own ear.', '1889', '60', '50', 'Oil on canvas', '250.0000', '300.0000', '2022-05-24 19:00:34', null, '0', '0');
INSERT INTO `paintings` VALUES ('65', '19', '29', '019080.jpg', 'Wheatfield with Crows', '4', 'https://www.vangoghmuseum.nl/en/collection/s0149V1962', 's0149V1962', 'Non commercial use', '<em>Wheatfield with Crows</em> is a July 1890 painting by Vincent van Gogh. It is commonly but mistakenly stated that this was Van Gogh\'s last painting. Art historians are uncertain as to which painting was Van Gogh\'s last, as no clear historical records exist, but the evidence of his letters suggests that Wheatfield with Crows was completed around 10 July and predates such paintings as Auvers Town Hall on 14 July 1890 and Daubigny\'s Garden.', '<em>Wheatfield with Crows</em> is a July 1890 painting by Vincent van Gogh. It is commonly but mistakenly stated that this was Van Gogh\'s last painting.', '1890', '50', '103', 'Oil on canvas', '300.0000', '350.0000', '2022-05-24 19:00:34', null, '0', '0');
INSERT INTO `paintings` VALUES ('66', '20', '11', '020040.jpg', 'A Sunday Afternoon on the Island of La Grande Jatt', '2', 'http://www.artic.edu/aic/collections/artwork/27992', null, 'Rights-Managed (RM)', 'Seurat spent over two years painting <em>A Sunday Afternoon</em>, focusing meticulously on the landscape of the park. He reworked the original as well as completed numerous preliminary drawings and oil sketches. He would go and sit in the park and make numerous sketches of the various figures in order to perfect their form. He concentrated on the issues of colour, light, and form. \r\nMotivated by study in optical and colour theory, Seurat contrasted miniature dots of colors that, through optical unification, form a single hue in the viewer\'s eye. He believed that this form of painting, now known as pointillism, would make the colors more brilliant and powerful than standard brush strokes. To make the experience of the painting even more vivid, he surrounded it with a frame of painted dots, which in turn he enclosed with a pure white, wooden frame, which is how the painting is exhibited today at the Art Institute of Chicago.\r\nIn creating the picture, Seurat employed the then-new pigment zinc yellow (zinc chromate), most visibly for yellow highlights on the lawn in the painting, but also in mixtures with orange and blue pigments. In the century and more since the painting\'s completion, the zinc yellow has darkened to brown—a colour degeneration that was already showing in the painting in Seurat\'s lifetime.', 'Seurat spent over two years painting <em>A Sunday Afternoon</em>, focusing meticulously on the landscape of the park. He reworked the original as well as completed numerous preliminary drawings and oil sketches. He would go and sit in the park and make numerous sketches of the various figures in order to perfect their form.', '1884', '208', '308', 'Oil on canvas', '425.0000', '550.0000', '2022-05-24 19:00:34', null, '0', '0');
INSERT INTO `paintings` VALUES ('67', '20', '19', '020070.jpg', 'Circus', '1', 'http://www.musee-orsay.fr/en/collections/works-in-focus/search/commentaire/commentaire_id/cirque-7090.html', 'RF 2511', '&copy; Home', null, null, '1891', '185', '152', 'Oil on canvas', '450.0000', '500.0000', '2022-05-24 19:00:34', null, '0', '0');
INSERT INTO `paintings` VALUES ('68', '21', '37', '021010.jpg', 'Mont Sainte-Victoire seen from Bellevue', '2', 'http://www.barnesfoundation.org/collections/art-collection/object/4672/mont-sainte-victoire-la-montagne-sainte-victoire', 'BF13', '&copy; The Barnes Foundation', '<em>Mont Sainte-Victoire seen from Bellevue</em> is a landscape painting dating from around 1885, by the French artist Paul Cézanne. The subject of the painting is the Montagne Sainte-Victoire in Provence in southern France. Cézanne spent a lot of time in Aix-en-Provence at the time, and developed a special relationship with the landscape. This particular mountain, that stood out in the surrounding landscape, he could see from his house, and he painted it in on numerous occasions.\r\nThe painting shows clearly Cézanne\'s project of rendering order and clarity to natural scenes, without giving up the optical realism of Impressionism. Both the light and the colours of the painting give the impression of a pattern that is not imposed on nature, but is there naturally.', '<em>Mont Sainte-Victoire seen from Bellevue</em> is a landscape painting dating from around 1885, by the French artist Paul Cézanne. The subject of the painting is the Montagne Sainte-Victoire in Provence in southern France. Cézanne spent a lot of time in Aix-en-Provence at the time, and developed a special relationship with the landscape.', '1885', '73', '92', 'Oil on canvas', '850.0000', '900.0000', '2022-05-24 19:00:34', null, '0', '0');
INSERT INTO `paintings` VALUES ('69', '21', '13', '021020.jpg', 'Portrait of Madame Cézanne with Loosened Hair', '1', 'http://www.philamuseum.org/collections/permanent/82555.html', '1986-26-1', 'Public Domain', '<em>Portrait of Madame Cézanne with Loosened Hair</em> (or Madame Cézanne with Unbound Hair) is an oil-on-canvas painting by French artist Paul Cézanne, variously dated from the mid 1870s to the early 1890s. Although the model, his wife Hortense Fiquet, was not supportive and did not understand or take an interest her husband\'s work, this is one of forty-four portraits in which she sat for him from 1869, a period during which she progressed from mistress, to wife, to ex-wife. Something of a socialite, Cézanne latterly found Fiquet often fickle and shallow, and once remarked, \"My wife only cares for Switzerland and lemonade\". The sensitivity and depth ascribed to her in this work, is likely drawn from his own personality, projected onto her image.', '<em>Portrait of Madame Cézanne with Loosened Hair</em> (or Madame Cézanne with Unbound Hair) is an oil-on-canvas painting by French artist Paul Cézanne, variously dated from the mid 1870s to the early 1890s. Although the model, his wife Hortense Fiquet, was not supportive and did not understand or take an interest her husband\'s work, this is one of forty-four portraits in which she sat for him from 1869.', '1869', '62', '51', 'Oil on canvas', '750.0000', '900.0000', '2022-05-24 19:00:34', null, '0', '0');
INSERT INTO `paintings` VALUES ('70', '21', '6', '021070.jpg', 'Card Players', '3', 'http://www.metmuseum.org/art/collection/search/435868', '61.101.1', 'Open Access for Scholarly Content', '<em>The Card Players</em> is a series of oil paintings from the French Post-Impressionist artist Paul Cézanne. Painted during Cézanne\'s final period in the early 1890s, there are five paintings in the series. The versions vary in size and in the number of players depicted. The series is considered by critics to be a cornerstone of Cézanne\'s work during the early-to-mid 1890s period, as well as a \"prelude\" to his final years, when he painted some of his most acclaimed work.\r\nEach painting depicts Provençal peasants immersed in smoking their pipes and playing cards. The subjects, all male, are displayed as studious within their card playing, eyes cast downward, intent on the game at hand. Cézanne adapted a motif from 17th century Dutch and French genre painting which often depicted card games with rowdy, drunken gamblers in taverns, replacing them instead with stone-faced tradesmen in a more simplified setting. Whereas previous paintings of the genre had illustrated heightened moments of drama, Cézanne\'s portraits have been noted for their lack of drama, narrative, and conventional characterization. Other than an unused wine bottle in the two-player versions, there is an absence of drink and money, which were prominent fixtures of the 17th century genre. A painting by one of the Le Nain brothers depicting card players at a museum in Aix-en-Provence, near the artist\'s residence, is widely believed to have been an inspiration for Cézanne.', '<em>The Card Players</em> is a series of oil paintings from the French Post-Impressionist artist Paul Cézanne. The series is considered by critics to be a cornerstone of Cézanne\'s work during the early-to-mid 1890s period, as well as a \"prelude\" to his final years, when he painted some of his most acclaimed work.', '1890', '134', '182', 'Oil on canvas', '200.0000', '275.0000', '2022-05-24 19:00:34', null, '0', '0');
INSERT INTO `paintings` VALUES ('71', '21', '20', '021060.jpg', 'Still Life With Apples', '2', 'http://www.moma.org/collection/works/78486?locale=en', '22.1934', '&copy; Art Resource', 'Throughout his life, the French painter Paul Cézanne returned again and again to the still life. Encompassing small—scale domestic scenes rather than grand public ones, still life was considered the lowliest of genres by the French Royal Academy, the official arbiter of great art in the nineteenth century. Yet in <em>Still Life with Apples</em>, Cézanne proved that this modest genre could be a vehicle for thinking through the Impressionist project of faithfully representing the appearance of light and space. \"Painting from nature is not copying the object,\" he wrote, \"it is realizing one\'s sensations.\"', 'Throughout his life, the French painter Paul Cézanne returned again and again to the still life. In <em>Still Life with Apples</em>, Cézanne proved that this modest genre could be a vehicle for thinking through the Impressionist project of faithfully representing the appearance of light and space.', '1890', '69', '93', 'Oil on canvas', '1225.0000', '1300.0000', '2022-05-24 19:00:34', null, '0', '0');
INSERT INTO `paintings` VALUES ('77', '24', '28', '024010.jpg', 'Sick Child', '3', 'http://www.nasjonalmuseet.no/en/collections_and_research/our_collections/edvard_munch_in_the_national_museum/The+Sick+Child%2C+1885%E2%88%9286.b7C_wljS4f.ips', 'NG.M.00839', '&copy; National Museum of Norway', 'Munch had a troubled familial past. In addition to his overbearing pietist father, his mother died of tuberculosis when he was a small child, and his sister died nine years later of the same disease. This painting is an image of Munch’s older and favorite sister Sophie lying in bed, dying of tuberculosis when she was 15 years old. Munch created many reproductions of this painting, including one that was held in Dresden, Germany. In the 1930’s and 40’s Nazi’s deemed Munch’s art as “degenerate art” and removed all of them from Germany to be sold at auction. This piece was bought and later donated to the Tate Gallery in London, where it remains today.', 'This painting is an image of Munch’s older and favorite sister Sophie lying in bed, dying of tuberculosis when she was 15 years old. Munch created many reproductions of this painting, including one that was held in Dresden, Germany.', '1885', '120', '118', 'Oil on canvas', '375.0000', '400.0000', '2022-05-24 19:00:34', null, '0', '0');
INSERT INTO `paintings` VALUES ('78', '24', '28', '024020.jpg', 'Death in the sickroom', '3', 'http://www.nasjonalmuseet.no/en/collections_and_research/our_collections/edvard_munch_in_the_national_museum/Death+in+the+Sick-Room%2C+prob.+1893.b7C_wljU3c.ips', 'NG.M.00940', '&copy; National Museum of Norway', 'The picture shows what we can assume to be the artist’s family grouped around his sister Sophie, who died in 1877. She is sitting in a chair with her back to us. To the right stands an aunt, Karen Bjølstad, who moved in with the family to take care of the children and the household after the mother died of tuberculosis in 1868. In the background stands the father, the doctor Christian Munch, with his hands clasped as if in prayer. Near the centre of the picture is a male figure, probably Edvard, in quarter-face. Sister Laura is sitting in the foreground with her hands in her lap, while the third sister, Inger, stands staring straight at us. The male figure to the left is generally identified as Edvard’s younger brother Andreas. In Death in the SickRoom there is no physical contact between the people, except for the hand that aunt Karen has laid on the back of the chair in which the invalid sits.', 'The picture shows what we can assume to be the artist’s family grouped around his sister Sophie, who died in 1877. She is sitting in a chair with her back to us.', '1892', '134', '160', 'Tempura and Crayon on canvas', '250.0000', '275.0000', '2022-05-24 19:00:34', null, '0', '0');
INSERT INTO `paintings` VALUES ('79', '24', '28', '024030.jpg', 'Cry (The Scream)', '1', 'http://www.nasjonalmuseet.no/en/collections_and_research/our_collections/edvard_munch_in_the_national_museum/The+Scream%2C+1893.b7C_wljU1a.ips', 'NG.M.00939', '&copy; National Museum of Norway', '<em>Scream</em> is the title of expressionist paintings and prints in a series by Norwegian artist Edvard Munch, showing an agonized figure against a blood red sky. The landscape in the background is the Oslofjord, viewed from the hill of Ekeberg, in Oslo (then Kristiania), Norway.\r\nEdvard Munch created several versions of Scream in various media. The Munch Museum holds one of two painted versions (1910, see gallery) and one pastel. The National Gallery of Norway holds the other painted version (1893, shown to right). A fourth version, in pastel, is owned by Norwegian businessman Petter Olsen. Munch also created a lithograph of the image in 1895.', '<em>Scream</em> is the title of expressionist paintings and prints in a series by Norwegian artist Edvard Munch, showing an agonized figure against a blood red sky. The landscape in the background is the Oslofjord, viewed from the hill of Ekeberg, in Oslo (then Kristiania), Norway.', '1893', '91', '74', 'Oil, tempera and pastel on cardboard', '175.0000', '225.0000', '2022-05-24 19:00:34', null, '0', '0');
INSERT INTO `paintings` VALUES ('80', '24', '28', '024040.jpg', 'Puberty', '1', 'http://www.nasjonalmuseet.no/en/collections_and_research/our_collections/edvard_munch_in_the_national_museum/Puberty%2C+1894%E2%80%9395.b7C_wljWWK.ips', 'NG.M.00807', '&copy; National Museum of Norway', '<em>Puberty</em> is a painting created by Edvard Munch. Munch is an artist native to Norway and is widely known for his role in expressionistic art. Puberty has also been done as a lithograph and an etching by Munch.\r\nUpon observation of Puberty one of the strongest points in the piece to most is first the adolescent female who is placed mid-center of the painting. The second almost \'haunting\' point in this painting is the shadow the female is meant to be casting. It has been speculated, because of the current sexual mind Munch was in during the time in which he painted this, that the shadow may be a hovering male genital. The thought of male genitalia to a young woman during this time of her own rapidly changing body creates a stench of tension within the piece. Another thought on the shadow is that it suggests the symbolic meaning of death. Both of these speculations on the shadow in this piece reflect well upon what Munch is known for symbolically portraying in his artwork. The female in Puberty had originally been thought to have been a model of Munch\'s while he was in Berlin. The strong detail used in the collar bones of her body suggests that he very well might have used a model. Either way this young lady is trapped in a space that alludes to much controversy within her mind and surroundings.', '<em>Puberty</em> is a painting created by Edvard Munch. Munch is an artist native to Norway and is widely known for his role in expressionistic art. Puberty has also been done as a lithograph and an etching by Munch.', '1894', '152', '110', 'Oil on canvas', '125.0000', '165.0000', '2022-05-24 19:00:34', null, '0', '0');
INSERT INTO `paintings` VALUES ('81', '24', '28', '024050.jpg', 'Madonna', '1', 'http://www.nasjonalmuseet.no/en/collections_and_research/our_collections/edvard_munch_in_the_national_museum/Madonna%2C+1894%E2%80%9395.b7C_wljU5e.ips', 'NG.M.00841', '&copy; National Museum of Norway', '<em>Madonna</em> is a painting by the Norwegian expressionist Edvard Munch. Munch painted five versions of the Madonna between 1894 and 1895, using oils on canvas. Although it is a highly unusual representation, nevertheless, this painting is of Mary, the mother of Jesus. True to the Norwegian cultural beliefs and way of life, the painting is a strong dose of conceivable realism.', '<em>Madonna</em> is a painting by the Norwegian expressionist Edvard Munch. Munch painted five versions of the Madonna between 1894 and 1895, using oils on canvas. Although it is a highly unusual representation, nevertheless, this painting is of Mary, the mother of Jesus.', '1895', '91', '70', 'Oil on canvas', '190.0000', '230.0000', '2022-05-24 19:00:34', null, '3', '0');
